    return (
        <>
            <Logo />
            <Wrapper>
                <Email>gfhdh</Email>
                <Senha>hghgfh</Senha>
                <Botão>entrar</Botão>
            </Wrapper>
        </>
    )
}

const Wrapper=styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`

const Email= styled.div`
    color:pink;
`
const Senha= styled.div`
    color:pink;
`
const Botão=styled.div`
	color: white;
	background: #52B6FF;
	border-radius: 5px;
    width: 303px;
    height: 45px;
    display: flex;
    align-itens: center;
    justify-content: center;
`
